import React from "react";
import PropTypes from 'prop-types';

export const ContactList = ({ contacts, onDeleteContact }) => {
return (
    <ul >{contacts.map(({ id, name, number}) => {
        return (
          <li key={id}>
           
      <p>{name}</p>
      <p>{number}</p>
      <button
        type="button"
        onClick={() => {
          onDeleteContact(id);
        }}
      >
        Delete
      </button>
        </li>
 );
      })}
    </ul >
    );
};

